import React from 'react';
import AppLayout from "../components/AppLayout";
import Head from 'next/head';
import { Descriptions, Avatar } from 'antd';

const Profile = () => {
    return (
        <>
            <Head>
                <title>프로필</title>
            </Head>
            <AppLayout>
                <Descriptions title="By-Juun(안병준)" bordered>
                    <Descriptions.Item label="한줄소개">JavaScript를 사랑하는 개발자</Descriptions.Item>
                    <Descriptions.Item label="Github "><a href="https://github.com/BY-juun">https://github.com/BY-juun</a></Descriptions.Item>
                    <Descriptions.Item label="Status" span={3}>
                        2017 아주대학교 소프트웨어학과
                        <br />
                        2021년 Github활동시작
                        <br />
                        2021년 블로그개설
                        <br />
                    </Descriptions.Item>
                </Descriptions>
            </AppLayout>
        </>
    );
}

export default Profile;
